import logo from './logo.svg';
import './App.css';
import Clock from "./components/Clock.js";
import Message from "./components/Message.js";
import Device from './components/Device.js';


function App() {
  return (
    <div>
      <Message/>
      <Clock><Device/></Clock>
    </div>
  );
}

export default App;
